def parseArguments():
    parser = argparse.ArgumentParser(description='>>> Generate vtk files (ParaView format) and a pvsm (ParaView state format) from both a grid.cdf file and a cdf file.')
    parser.add_argument('-gcdf',
                        dest='gcdf',
                        required=True,
                        help='[Required] The path of the grid.cdf file',
                        nargs=1)
    parser.add_argument('-cdf',
                        dest='cdf',
                        required=True,
                        help='[Required] The path of the cdf file',
                        nargs=1)

    parser.add_argument('-o',
                        dest='output',
                        help='[Optional] The output folder where the files will be generated (Default: current directory)',
                        nargs=1,
                        default=None)

    parse_args = parser.parse_args()
    return parse_args


def writePVDHeader(pvd_file):
    pvd_file.write('<?xml version="1.0"?>\n<VTKFile type="Collection" version="0.1" byte_order="LittleEndian" compressor="vtkZLibDataCompressor">\n<Collection>\n')


def writePVDFooter(pvd_file):
    pvd_file.write('</Collection>\n</VTKFile>\n')
    pvd_file.close()


def writePVDEntry(pvd_file, frame_no, fname, suffix):
    pvd_file.write('<DataSet timestep="' + str(frame_no) + '" group="" part="0" file="' + fname + '.' + suffix + '"/>\n')


def insideBBox(bbox_min, bbox_max, x, y, z):
    return (x <= bbox_max(0) and x >= bbox_min(0) and y <= bbox_max(1) and y >= bbox_min(1) and z <= bbox_max(2) and z >= bbox_min(2))


def spline(cv, npts):
    tck, u_ = si.splprep(cv.T,s=0.0)
    return si.splev(np.linspace(0, 1, npts), tck)


def grid_vtk_conversion(gcdf, output):
    in_fname = os.path.splitext(os.path.basename(gcdf))[0]
    grid_set = Grid.DRegularGridSet()
    cdf_reader = Grid.FileCDFDRegularGridSetReader(gcdf)
    pvd_file = open(os.path.join(output, in_fname + '.pvd'), 'w')

    writePVDHeader(pvd_file)
    frame_no = 0
    while True:
        grid_set.clear()

        if not cdf_reader.read(grid_set):
            break

        output_data = {}
        grid_spacing = None
        grid_origin = None
        for grid in grid_set:
            int_descr = Grid.getName(grid)
            grid_values = np.ndarray((grid.getSize1(), grid.getSize2(), grid.getSize3()), np.float32)
            output_data[int_descr] = grid_values

            for i in range(grid.getSize1()):
                for j in range(grid.getSize2()):
                    for k in range(grid.getSize3()):
                        grid_values[i, j, k] = grid(i, j, k)

            if not grid_spacing:
                grid_spacing = (grid.getXStepSize(), grid.getYStepSize(), grid.getZStepSize())

            if not grid_origin:
                grid_origin = Math.Vector3D()
                grid.getCoordinates(0, 0, 0, grid_origin)

        out_fname = in_fname + '_frame_no_' + str(frame_no)
        out_path = os.path.join(output, out_fname)

        print('> Writing grid data for frame {} ...'.format(frame_no))

        if not hl.imageToVTK(out_path, origin=grid_origin, spacing=grid_spacing, pointData=output_data):
            print('!!! Could not write grid output file.')
            return

        writePVDEntry(pvd_file, frame_no, out_fname, 'vti')

        frame_no += 1
    writePVDFooter(pvd_file)


def trj_vtk_conversion(cdf, output):

    SPLINE_POINTS_PER_BB_ATOM = 10
    GRID_BOX_MIN_X = -14.5 - 5
    GRID_BOX_MIN_Y = 42.0 - 5
    GRID_BOX_MIN_Z = 4.26 - 5
    GRID_BOX_MAX_X = -4.5 + 5
    GRID_BOX_MAX_Y = 53.5 + 5
    GRID_BOX_MAX_Z = 18.26 + 5

    in_fname = os.path.splitext(os.path.basename(cdf))[0]
    mol = Chem.BasicMolecule()
    cdf_reader = Chem.FileCDFMoleculeReader(cdf)
    pvd_file = open(os.path.join(output, in_fname + '.pvd'), 'w')

    writePVDHeader(pvd_file)

    if not cdf_reader.read(mol):
        return

    backbone_atoms = [atom for atom in mol.atoms if  Chem.getType(atom) == Chem.AtomType.C and Biomol.isPDBBackboneAtom(atom) and Biomol.getResidueAtomName(atom) == 'C']

    bond_list = []
    for bond in mol.bonds:
        if Biomol.getResidueCode(bond.getAtom(0)) == 'HOH' or Biomol.getResidueCode(bond.getAtom(1)) == 'HOH':
            continue

        if Chem.getType(bond.getAtom(0)) == Chem.AtomType.H or Chem.getType(bond.getAtom(1)) == Chem.AtomType.H:
            continue

        bond_list.append(bond)

    num_confs = Chem.getNumConformations(mol)
    num_coords = len(bond_list) * 4 + (len(backbone_atoms) * SPLINE_POINTS_PER_BB_ATOM - 1) * 2
    bond_ctr = Math.Vector3D()
    i = 0

    bbox_min = Math.Vector3D()
    bbox_max = Math.Vector3D()

    bbox_min[0] = GRID_BOX_MIN_X
    bbox_min[1] = GRID_BOX_MIN_Y
    bbox_min[2] = GRID_BOX_MIN_Z

    bbox_max[0] = GRID_BOX_MAX_X
    bbox_max[1] = GRID_BOX_MAX_Y
    bbox_max[2] = GRID_BOX_MAX_Z

    while i < num_confs:
        line_x_coords = np.ndarray(num_coords, np.float32)
        line_y_coords = np.ndarray(num_coords, np.float32)
        line_z_coords = np.ndarray(num_coords, np.float32)
        atom_types = np.ndarray(num_coords, np.uint32)

        spline_ctrl_points = np.ndarray((len(backbone_atoms), 3), np.float32)
        j = 0

        for atom in backbone_atoms:
            atom_pos = Chem.getConformer3DCoordinates(atom, i)

            spline_ctrl_points[j, 0] = atom_pos(0)
            spline_ctrl_points[j, 1] = atom_pos(1)
            spline_ctrl_points[j, 2] = atom_pos(2)
            j += 1

        spline_pts = spline(spline_ctrl_points, len(backbone_atoms) * SPLINE_POINTS_PER_BB_ATOM)
        j = 0
        k = 0

        while k < (len(backbone_atoms) * SPLINE_POINTS_PER_BB_ATOM - 1):
            line_x_coords[j] = spline_pts[0][k]
            line_y_coords[j] = spline_pts[1][k]
            line_z_coords[j] = spline_pts[2][k]
            atom_types[j] = 0
            j += 1

            line_x_coords[j] = spline_pts[0][k + 1]
            line_y_coords[j] = spline_pts[1][k + 1]
            line_z_coords[j] = spline_pts[2][k + 1]
            atom_types[j] = 0
            j += 1
            k += 1

        for bond in bond_list:
            atom1 = bond.getAtom(0)
            atom2 = bond.getAtom(1)

            atom1_pos = Chem.getConformer3DCoordinates(atom1, i)
            atom2_pos = Chem.getConformer3DCoordinates(atom2, i)

            atom1_type = Chem.getType(atom1)
            atom2_type = Chem.getType(atom2)

            bond_ctr.assign(atom1_pos)
            bond_ctr += atom2_pos
            bond_ctr *= 0.5

            line_x_coords[j] = atom1_pos(0)
            line_y_coords[j] = atom1_pos(1)
            line_z_coords[j] = atom1_pos(2)
            atom_types[j] = atom1_type
            j += 1

            line_x_coords[j] = bond_ctr(0)
            line_y_coords[j] = bond_ctr(1)
            line_z_coords[j] = bond_ctr(2)
            atom_types[j] = atom1_type
            j += 1

            line_x_coords[j] = bond_ctr(0)
            line_y_coords[j] = bond_ctr(1)
            line_z_coords[j] = bond_ctr(2)
            atom_types[j] = atom2_type
            j += 1

            line_x_coords[j] = atom2_pos(0)
            line_y_coords[j] = atom2_pos(1)
            line_z_coords[j] = atom2_pos(2)
            atom_types[j] = atom2_type
            j += 1

        line_x_coords.resize(j)
        line_y_coords.resize(j)
        line_z_coords.resize(j)
        atom_types.resize(j)

        out_fname = in_fname + '_frame_no_' + str(i)
        out_path = os.path.join(output, out_fname)
        line_data = {'atom_type': atom_types}

        print('> Writing structure data for frame {} ...'.format(i))

        if not hl.linesToVTK(out_path, line_x_coords, line_y_coords, line_z_coords, pointData=line_data):
            print('!!! Could not write structure output file.')
            return

        writePVDEntry(pvd_file, i, out_fname, 'vtu')

        i += 1

    writePVDFooter(pvd_file)

